import React from 'react'
import './Popup.scss';
import {Ptw} from '../context/PtwContext';

export default function Popup(props) {
  let theUsedContext = React.useContext(Ptw);

  let popupValue = 
  (
    <div className='popup__container'>


      <div className='popup__window'>
      <button className='popup__close' onClick={
        () => {
          theUsedContext.dispatch ({type: "CLOSE__POPUP"})
        }
      }>x</button>
      {
        // <h1>{theUsedContext.ptwState.ptw[theUsedContext.ptwState.ptwId].number}</h1>
      }
      </div>      
    </div>
  )

  return (
    <>
      {
        theUsedContext.ptwState.popupShow && popupValue
      }
    </>
  )
}
